function WelcomePage(){
    var req = new XMLHttpRequest()
    req.open("GET", ".././json_lib/language.json")
    req.onreadystatechange = function(){
        if(this.readyState === 4){
            console.log(this.response)
        }
    }
    req.send()
    return (
        <div>
            안녕안녕
        </div>
    )
}
export default WelcomePage;
